    ": Particles are close together but can move past one another. Liquids have a definite volume but take the shape of their container.": ": कण एक दूसरे के करीब होते हैं लेकिन एक दूसरे से आगे बढ़ सकते हैं। तरल पदार्थों का आयतन निश्चित होता है लेकिन वे अपने पात्र का आकार ले लेते हैं।",
    ": Particles are far apart and move freely at high speeds. Gases have no definite shape or volume and will expand to fill their container.": ": कण दूर-दूर होते हैं और उच्च गति से स्वतंत्र रूप से चलते हैं। गैसों का कोई निश्चित आकार या आयतन नहीं होता है और वे अपने कंटेनर को भरने के लिए विस्तारित होंगी।",
    ": Particles are forced close together; volume and intermolecular forces become significant.": ": कणों को बलपूर्वक एक-दूसरे के करीब लाया जाता है; आयतन और अंतरआण्विक बल महत्वपूर्ण हो जाते हैं।",
    ": Particles are tightly packed in a fixed structure. They vibrate in place but do not move freely. Solids have a definite shape and volume.": ": कण एक निश्चित संरचना में कसकर बंधे होते हैं। वे जगह-जगह कंपन करते हैं लेकिन स्वतंत्र रूप से नहीं चलते हैं। ठोसों का एक निश्चित आकार और आयतन होता है।",
    ": Particles have volume and intermolecular forces": ": कणों में आयतन और अंतराआण्विक बल होते हैं",
    ": Particles move slowly; attractive forces have greater effect, causing deviation.": ": कण धीरे-धीरे चलते हैं; आकर्षक शक्तियों का प्रभाव अधिक होता है, जिससे विचलन होता है।",
