    ": Unsaturated solution": ": असंतृप्त विलयन",
    ": Use conversion factors as fractions equal to 1. E.g., 60 mph × (1609 m / 1 mi) × (1 hr / 3600 s) ≈ 26.8 m/s.": ": रूपांतरण कारकों का उपयोग 1 के बराबर भिन्नों के रूप में करें। उदाहरण के लिए, 60 मील प्रति घंटे × (1609 मीटर / 1 मील) × (1 घंटा / 3600 सेकेंड) ≈ 26.8 मीटर/सेकेंड।",
    ": Use the charge of each ion as the subscript of the other to write formulas.": ": सूत्र लिखने के लिए प्रत्येक आयन के आवेश को दूसरे के उपस्क्रिप्ट के रूप में उपयोग करें।",
    ": Used for combustion reactions; measures heat at constant volume.": ": दहन प्रतिक्रियाओं के लिए उपयोग किया जाता है; स्थिर आयतन पर ऊष्मा मापता है।",
    ": Used for life processes": ": जीवन प्रक्रियाओं के लिए उपयोग किया जाता है",
