    ": Uses electron beams": ": इलेक्ट्रॉन किरणों का उपयोग करता है",
    ": Uses element symbols and subscripts to show the composition of a compound (e.g., H₂O).": ": किसी यौगिक की संरचना (जैसे, H₂O) दिखाने के लिए तत्व प्रतीकों और सबस्क्रिप्ट का उपयोग करता है।",
    ": Uses the decay of carbon-14 to determine the age of organic materials up to ~50,000 years.": ": ~50,000 वर्ष तक के कार्बनिक पदार्थों की आयु निर्धारित करने के लिए कार्बन-14 के क्षय का उपयोग करता है।",
    ": Uses the preceding noble gas symbol in brackets to abbreviate (e.g., [Ne] 3s² 3p³ for phosphorus).": ": संक्षिप्त करने के लिए कोष्ठक में पूर्ववर्ती उत्कृष्ट गैस प्रतीक का उपयोग करता है (उदाहरण के लिए, फॉस्फोरस के लिए [Ne] 3s² 3p³)।",
