    ": Usually increases": ": आमतौर पर बढ़ जाती है",
    ": Usually indicates experimental error (e.g., impurities adding mass).": ": आमतौर पर प्रयोगात्मक त्रुटि को इंगित करता है (उदाहरण के लिए, द्रव्यमान जोड़ने वाली अशुद्धियाँ)।",
    ": V and I are in phase. P = I²R.": ": V और I चरण में हैं। पी = आई²आर.",
