    "A Cone is a solid with a circular base and a vertex (apex) not in the plane of the base.": "शंकु एक ठोस है जिसका आधार वृत्ताकार है और शीर्ष (शीर्ष) आधार के तल में नहीं है।",
    "A Cylinder is a solid with two parallel circular bases connected by a curved surface.": "सिलेंडर एक ठोस है जिसके दो समानांतर गोलाकार आधार एक घुमावदार सतह से जुड़े होते हैं।",
