    "A bag has 4 green and 6 yellow marbles. You draw two marbles without replacement. What is P(green, then green)?": "एक बैग में 4 हरे और 6 पीले मार्बल हैं। आप बिना प्रतिस्थापन के दो कंचे खींचते हैं। P(हरा, फिर हरा) क्या है?",
    "A bag has 5 red and 3 blue marbles. You draw one marble, replace it, then draw again. What is P(red, then blue)?": "एक थैले में 5 लाल और 3 नीले कंचे हैं। आप एक मार्बल बनाएं, उसे बदलें, फिर दोबारा बनाएं। P(लाल, फिर नीला) क्या है?",
    "A balanced equation has equal numbers of each type of:": "एक संतुलित समीकरण में प्रत्येक प्रकार की समान संख्याएँ होती हैं:",
    "A ball on a string: tension provides centripetal force.": "एक डोरी पर एक गेंद: तनाव अभिकेन्द्रीय बल प्रदान करता है।",
