    "A composition of transformations is a combination of two or more transformations applied in sequence. The result of the first transformation is used as the input for the second.": "परिवर्तनों की एक संरचना क्रम में लागू दो या दो से अधिक परिवर्तनों का एक संयोजन है। पहले परिवर्तन का परिणाम दूसरे के लिए इनपुट के रूप में उपयोग किया जाता है।",
