    "A concave (diverging) lens has what kind of focal length?": "अवतल (अपसारी) लेंस की फोकल लंबाई किस प्रकार की होती है?",
    "A concave mirror can form both real and virtual images — true or false?": "एक अवतल दर्पण वास्तविक और आभासी दोनों छवियाँ बना सकता है - सही या गलत?",
