    "A concentrated solution has:": "एक सांद्रित विलयन में है:",
    "A concentrated solution used to prepare dilute solutions": "पतला घोल तैयार करने के लिए उपयोग किया जाने वाला एक सांद्र घोल",
    "A conditional and its contrapositive always have the same truth value. The converse and inverse also share the same truth value (but may differ from the original).": "एक सशर्त और उसके गर्भनिरोधक का सत्य मान हमेशा समान होता है। विपरीत और विपरीत भी समान सत्य मान साझा करते हैं (लेकिन मूल से भिन्न हो सकते हैं)।",
    "A conditional and its contrapositive:": "",
    "A conditional is false ONLY when the hypothesis is true and the conclusion is false.": "एक सशर्त केवल तभी गलत होता है जब परिकल्पना सत्य हो और निष्कर्ष गलत हो।",
    "A conditional statement (or if-then statement) has two parts: the hypothesis (\"if\") and the conclusion (\"then\"). It is written in the form: If p, then q (p → q).": "एक सशर्त कथन (या यदि-तब कथन) के दो भाग होते हैं: परिकल्पना (\"यदि\") और निष्कर्ष (\"तब\")। इसे इस रूप में लिखा गया है: यदि p, तो q (p → q)।",
    "A conditional statement has the form \"If p, then q\" (written p → q). The hypothesis is p and the conclusion is q.": "एक सशर्त कथन का रूप \"यदि पी, तो क्यू\" (लिखित पी → क्यू) है। परिकल्पना p है और निष्कर्ष q है।",
    "A conditional statement has the form “If p, then q” (written p → q). The hypothesis is p and the conclusion is q.": "एक सशर्त कथन का रूप \"यदि पी, तो क्यू\" (लिखित पी → क्यू) है। परिकल्पना p है और निष्कर्ष q है।",
    "A conditional statement is a statement of the form \"if p, then q.\" The statement p is called the hypothesis, and the statement q is called the conclusion. It is written as p → q (read as \"if p, then q\" or \"p implies q\").": "एक सशर्त बयान \"यदि पी, तो क्यू\" फॉर्म का एक बयान है। कथन p को परिकल्पना कहा जाता है, और कथन q को निष्कर्ष कहा जाता है। इसे p → q के रूप में लिखा जाता है (इसे \"यदि p, तो q\" या \"p का अर्थ q है\" के रूप में पढ़ें)।",
    "A cone has a height of 12 cm and a radius of 5 cm. What is its slant height?": "एक शंकु की ऊंचाई 12 सेमी और त्रिज्या 5 सेमी है। इसकी तिरछी ऊंचाई क्या है?",
