    "A figure has an area of 50 cm². A similar figure has a scale factor of 3 relative to the original. What is the area of the larger figure?": "एक आकृति का क्षेत्रफल 50 सेमी² है। एक समान आकृति का स्केल फैक्टर मूल के सापेक्ष 3 है। बड़ी आकृति का क्षेत्रफल क्या है?",
    "A figure has line symmetry if a reflection over a line maps the figure onto itself. The line is called the line of symmetry (or axis of symmetry).": "किसी आकृति में रेखा समरूपता होती है यदि रेखा पर प्रतिबिंब आकृति को स्वयं पर मैप करता है। रेखा को सममिति रेखा (या सममिति अक्ष) कहा जाता है।",
    "A figure has line symmetry if it can be reflected over a line and map onto itself; that line is the line of symmetry": "एक आकृति में रेखा समरूपता होती है यदि इसे एक रेखा पर प्रतिबिंबित किया जा सकता है और स्वयं पर मानचित्र बनाया जा सकता है; वह रेखा सममिति रेखा है",
    "A figure has point symmetry if a 180° rotation maps it onto itself. This is rotational symmetry of order 2.": "किसी आकृति में बिंदु समरूपता होती है यदि 180° का घुमाव उसे स्वयं पर मैप करता है। यह क्रम 2 की घूर्णी समरूपता है।",
    "A figure has point symmetry if it has rotational symmetry of order 2 (maps onto itself after a 180-degree rotation)": "किसी आकृति में बिंदु समरूपता होती है यदि उसमें क्रम 2 की घूर्णी समरूपता होती है (180-डिग्री घूर्णन के बाद स्वयं पर मानचित्रित होती है)",
    "A figure has point symmetry if it maps onto itself after a rotation of __________.": "एक आकृति में बिंदु समरूपता होती है यदि यह __________ के घूर्णन के बाद स्वयं पर मानचित्रित होती है।",
    "A figure has rotational symmetry if a rotation of less than 360° maps the figure onto itself. The smallest such angle is the angle of rotational symmetry.": "किसी आकृति में घूर्णी समरूपता होती है यदि 360° से कम का घूर्णन आकृति को स्वयं पर मैप करता है। ऐसा सबसे छोटा कोण घूर्णी समरूपता का कोण है।",
    "A figure has rotational symmetry if it can be rotated less than 360 degrees about its center and map onto itself": "एक आकृति में घूर्णी समरूपता होती है यदि इसे अपने केंद्र के बारे में 360 डिग्री से कम घुमाया जा सकता है और खुद पर मानचित्र बनाया जा सकता है",
    "A figure has symmetry if there is a rigid motion that maps the figure onto itself": "किसी आकृति में समरूपता होती है यदि कोई कठोर गति होती है जो आकृति को स्वयं पर मैप करती है",
