    "If three sides of one Triangle are congruent to three sides of another Triangle, the triangles are congruent.": "यदि एक त्रिभुज की तीन भुजाएँ दूसरे त्रिभुज की तीन भुजाओं के सर्वांगसम हों, तो त्रिभुज सर्वांगसम होते हैं।",
