    "If two angles and a non-included side of one Triangle are congruent to the corresponding parts of another Triangle, the triangles are congruent.": "यदि एक त्रिभुज के दो कोण और एक गैर-शामिल भुजा दूसरे त्रिभुज के संगत भागों के सर्वांगसम हों, तो त्रिभुज सर्वांगसम होते हैं।",
    "If two angles and the included side of one Triangle are congruent to two angles and the included side of another Triangle , the triangles are congruent .": "यदि एक त्रिभुज के दो कोण और सम्मिलित भुजा दूसरे त्रिभुज के दो कोणों और सम्मिलित भुजा के सर्वांगसम हों, तो त्रिभुज सर्वांगसम होते हैं।",
    "If two angles and the included side of one Triangle are congruent to two angles and the included side of another Triangle, the triangles are congruent.": "यदि एक त्रिभुज के दो कोण और सम्मिलित भुजा दूसरे त्रिभुज के दो कोणों और सम्मिलित भुजा के सर्वांगसम हों, तो त्रिभुज सर्वांगसम होते हैं।",
    "If two angles are congruent, the sides opposite them are congruent": "यदि दो कोण सर्वांगसम हों, तो उनकी सम्मुख भुजाएँ सर्वांगसम होती हैं",
    "If two angles are congruent, the third must also be congruent (since angles sum to 180°). Once all angles match, the sides are automatically proportional.": "यदि दो कोण सर्वांगसम हैं, तो तीसरा भी सर्वांगसम होना चाहिए (क्योंकि कोणों का योग 180° होता है)। एक बार जब सभी कोण मेल खाते हैं, तो भुजाएँ स्वचालित रूप से आनुपातिक हो जाती हैं।",
    "If two angles form a linear pair, they are supplementary": "यदि दो कोण एक रैखिक युग्म बनाते हैं, तो वे संपूरक होते हैं",
